import re
from typing import List
from core.gunnershell.bofs.base import Bof, register
from colorama import Style, Fore

brightgreen = "\001" + Style.BRIGHT + Fore.GREEN + "\002"
brightyellow = "\001" + Style.BRIGHT + Fore.YELLOW + "\002"
reset = Style.RESET_ALL

def _is_ip(h: str) -> bool:
    if not h: return False
    h = h.strip()
    if ':' in h or h.startswith('['):  # IPv6-ish
        return True
    m = re.match(r'^\d{1,3}(\.\d{1,3}){3}$', h)
    if not m: return False
    return all(0 <= int(p) <= 255 for p in h.split('.'))

@register("dcsyncenum")
class DCSyncEnumBof(Bof):
    base64bof: str = ""
    x86base64bof: str = ""

    @staticmethod
    def help_menu():
        menu = """
dcsyncenum — Read-only audit of DCsync-relevant rights (LDAP/LDAPS)

Usage
  bofexec dcsyncenum [options]

Core target & connection
  --dc <host>                    Domain Controller hostname/FQDN. Omit → locator.
  --ldaps                        Use LDAPS
  --port <int>                   Override port (default: 636 if LDAPS else 389).
  --baseDN <dn>                  Override base (default: domain NC).
  --scope domain|config|both     Where to evaluate rights (default: domain).
  --rights <csv>                 From: replicate,replicate-all,replicate-filtered, write-dacl,write-owner,generic-all (default: replicate,replicate-all,replicate-filtered)
  --include-escalation           Also flag write-dacl/write-owner/generic-all

Resolution & accuracy
  --effective                    Compute effective rights (group recursion)
  --include-inherited            Include inherited ACEs 
  --deny-only                    Show only explicit DENY ACEs 
  --resolve-sids                 SID→name resolution
  --exclude <csv>                Suppress well-known/builtin principals by name or SID.

Stealth & performance
  --page-size <int>              LDAP paging size (default: 500).
  --throttle-ms <int>            Sleep between pages/queries (default: 50).
  --max-objects <int>            Hard stop to bound runtime (default: 5000).
  --timeout-ms <int>             LDAP op timeout (default: 10000).
  --referrals none|external|all  Referral handling (default: external).
  --attrs-min                    Request minimal attributes

Output
  --format table|csv|json|pretty Output format (default: pretty).
  --quiet                        IDs/SIDs only
  --show-membership-path         Include shortest group chain

Columns (table/csv/json)
  principal | sid | right | object_dn | scope | via | membership_path | confidence | notes | timestamp

Examples
  bofexec dcsyncenum
  bofexec dcsyncenum --scope both --format csv --exclude "NT AUTHORITY\\SYSTEM,Domain Controllers"
  bofexec dcsyncenum --include-escalation 1 --deny-only 1
"""

        print(brightgreen + menu + reset)
        return

    @staticmethod
    def args_inject(p):
        # Core target & connection
        p.add_argument("--dc", default="", help="Domain Controller hostname/FQDN. Empty => locator")
        p.add_argument("--ldaps", action="store_true", default=False, help="Use LDAPS (default 1)")
        p.add_argument("--port", type=int, default=0, help="Override port (default 636 if LDAPS else 389)")
        p.add_argument("--baseDN", default="", help="Override base (default: domain NC)")
        p.add_argument("--scope", default="domain", choices=["domain","config","both"], help="Where to evaluate rights")
        p.add_argument("--rights", default="replicate,replicate-all,replicate-filtered", help="Comma list: replicate,replicate-all,replicate-filtered,write-dacl,write-owner,generic-all")
        p.add_argument("--include-escalation", action="store_true", default=True, help="Also flag write-dacl/write-owner/generic-all")
        # Resolution & accuracy
        p.add_argument("--effective", default=True, action="store_true", help="Compute effective rights (group recursion)")
        p.add_argument("--include-inherited", default=True, action="store_true", help="Include inherited ACEs")
        p.add_argument("--deny-only", default=False, action="store_true", help="Only show explicit DENY ACEs")
        p.add_argument("--resolve-sids", default=True, action="store_true", help="SID→name resolution")
        p.add_argument("--exclude", default="", help="CSV of principals to suppress (names or SIDs)")
        # Stealth & perf
        p.add_argument("--page-size", type=int, default=500, help="LDAP paging size")
        p.add_argument("--throttle-ms", type=int, default=50, help="Sleep between queries")
        p.add_argument("--max-objects", type=int, default=5000, help="Hard stop bound")
        p.add_argument("--timeout-ms", type=int, default=10000, help="LDAP op timeout")
        p.add_argument("--referrals", default="external", choices=["none","external","all"], help="Referral handling")
        p.add_argument("--attrs-min", default=True, action="store_true", help="Request minimal attrs")
        # Output
        p.add_argument("--format", default="pretty", choices=["table","csv","json", "pretty"], help="Output format")
        p.add_argument("--quiet", default=False, action="store_true", help="IDs/SIDs only")
        p.add_argument("--show-membership-path", action="store_true", default=True, help="Include a short membership chain (when --effective=1)")

    @staticmethod
    def build_remote_args(ns) -> List[str]:
        dc = (getattr(ns, "dc", "") or "").strip()
        if dc and _is_ip(dc):
            print(brightyellow + "--dc must be a hostname/FQDN, not an IP" + reset)
            return

        use_ldaps = 1 if ns.ldaps else 0
        port_in   = int(getattr(ns, "port", 0))
        port      = port_in if port_in>0 else (636 if use_ldaps else 389)
        # Pack in BOF order/types (Z = wide string, i = int)
        basedn = getattr(ns, 'baseDN', '') or ''
        scope = getattr(ns, 'scope', 'domain')
        rights = getattr(ns, 'rights', '') or ''
        include_escalation = 1 if ns.include_escalation else 0
        effective = 1 if ns.effective else 0
        include_inherited = 1 if ns.include_inherited else 0
        deny_only = 1 if ns.deny_only else 0
        resolve_sids = 1 if ns.resolve_sids else 0
        exclude = getattr(ns, 'exclude', '') or ''
        page_size = int(getattr(ns, 'page_size', 500))
        throttle_ms = int(getattr(ns, 'throttle_ms', 50))
        max_objects = int(getattr(ns, 'max_objects', 5000))
        timeout_ms = int(getattr(ns, 'timeout_ms', 10000))
        refferals = getattr(ns, 'referrals', 'external')
        attrs_min = 1 if ns.attrs_min else 0
        formatoutput = getattr(ns, 'format', 'pretty')
        quiet = 1 if ns.quiet else 0
        show_membership_path = 1 if ns.show_membership_path else 0

        args = [
            f"-Z:{dc}",
            f"-i:{use_ldaps}",
            f"-i:{port}",
            f"-Z:{basedn}",
            f"-Z:{scope}",
            f"-Z:{rights}",
            f"-i:{include_escalation}",
            f"-i:{effective}",
            f"-i:{include_inherited}",
            f"-i:{deny_only}",
            f"-i:{resolve_sids}",
            f"-Z:{exclude}",
            f"-i:{page_size}",
            f"-i:{throttle_ms}",
            f"-i:{max_objects}",
            f"-i:{timeout_ms}",
            f"-Z:{refferals}",
            f"-i:{attrs_min}",
            f"-Z:{formatoutput}",
            f"-i:{quiet}",
            f"-i:{show_membership_path}",
        ]

        #print(args)
        return args
